Invoice-On-The-Go is an accounting app made for non-accountants. Our easy-to-use platform has a wide range of features that were created with an aim to help you manage your business. This app is perfect financial tool for self-employed and small businesses.
With Invoice-On-The-Go you can:
- Manage up to 5 businesses under one subscription;
- Send unlimited number of invoices;
- Track payments and overdue invoices;
- Easy upload and hold job receipts until ready to bill;
- Attach expenses to invoice with one click;
- Generate financial performance reports;
- Create and send customer statements;
- Monitor billings during any date range for any customer;
- Keep track of state and local sales tax.

Subscriptions: 
- FREE first THREE invoices, then MONTHLY ($9.99/mo) or ANNUAL ($99/year) subscriptions.
- Each subscription gives an unlimited and unrestricted access to all features of the app.
- Payment will be charged to iTunes Account at confirmation of purchase.
- Subscription automatically renews unless auto-renew is turned off at least 24-hours before the end of the current period.
- Account will be charged for renewal within 24-hours prior to the end of the current period, and identify the cost of the renewal.
- Subscriptions may be managed by the user and auto-renewal may be turned off by going to the user's Account Settings after purchase.
- Any unused portion of a free trial period, if offered, will be forfeited when the user purchases a subscription to that publication, where applicable.
